import React from 'react';
import firebase from 'firebase';
import PropTypes from 'prop-types';
import { PanelHeader, Panel, PanelHeaderBack, Text, Caption } from '@vkontakte/vkui';
import "@vkontakte/vkui/dist/vkui.css";




const Pets = ({ id, go}) => (
	<Panel id={id}>
		<PanelHeader left={<PanelHeaderBack onClick={go} data-to="home"/>}>Питомцы</PanelHeader>
        <Text>Совсем скоро тут что-то появится.</Text>
        <Caption level="2" weight="regular" style={{ marginBottom: 16 }}>Caption 2 regular</Caption>
	</Panel>
);


Pets.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
};

export default Pets;
